import React, { Component,  useEffect, useState  } from "react";
import axios from 'axios';
import {API_ENDPOINT} from '../../config'


export default function PortfolioList(){
    const [porfolio,setPortfolio]=useState("")
            const authAxios = axios.create({
                baseURL: API_ENDPOINT,
                headers: {
                  },
                
                });
                useEffect(() => {
                    (async () => {
                      try {
                        const result = await authAxios.get('/Projects');
                     
                
                        setPortfolio(result.data);
                        console.log(result.data)
                      }
                      catch(err) {
        
                        console.log(err.message);
                      }
                    })();
                  });
    
        const PortfolioListContent = [
            {
                image: 'image-1',
                category: 'Development',
                title: 'Getting tickets to the big show'
            },
            {
                image: 'image-1',
                category: 'Development',
                title: 'Getting tickets to the big show'
            }
         
        ]

        const list = PortfolioListContent.slice(0 );
        return(
            <React.Fragment> 
                {list.map((value , index) => (
                    <div className="col-lg-4 col-md-6 col-sm-6 col-12">
                        <div className="portfolio text-center mt--40">
                            <div className="thumbnail-inner">
                                <div className={`thumbnail ${value.image}`}><img className="w-100" src="/assets/images/about/me.jpg" alt="About Images"/></div>
                                <div className={`bg-blr-image ${value.image}`}><img className="w-100" src="/assets/images/about/me.jpg" alt="About Images"/></div>
                            </div>
                            <div className="content">
                                <div className="inner">
                                    <p>{value.category}</p>
                                    <h4><a href="/portfolio-details">{value.title}</a></h4>
                                    <div className="portfolio-button">
                                        <a className="rn-btn" href="/portfolio-details">View Details</a>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                ))}
               
            </React.Fragment>
        )
    }
